import React from "react";
import "./Navbar.css";
import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <nav className="Nav">
      <ul className="Nav-items">
        <li>
          <Link className="Nav-item" to="/Profile">
            Profile
          </Link>
        </li>
        <li>
          <Link className="Nav-item" to="/">
            Calendar
          </Link>
        </li>
        <li>
          <Link className="Nav-item" to="/Workouts">
            Workouts
          </Link>
        </li>
      </ul>
    </nav>
  );
};

export default Navbar;
